import { BrowserRouter, Routes, Route } from "react-router-dom";


import rootx from "./pages/Root";

function App() {
  return (
    <div>
      <BrowserRouter>
  
        <Routes>
          <Route path="/" element={<root/>} />
         
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
